const Main = () => {
  return (
    <div className="mainProf">
      <div className="cvImg"><img src="/Users/ghadier/Desktop/heroku/cv-task/92247998.png" width="200px"></img></div>
      <h1>Ghadier Mutar</h1>
      <h2>Junior JS Developer </h2>
      <hr></hr>
      <p>Buraidah,Saudi Arabia</p>
      <p>Ghadier.Mutar.elq.js@tuwaiq.edu.sa</p> <hr></hr>
      <img src="https://img.icons8.com/windows/32/000000/twitter.png"/>      <img src="https://img.icons8.com/ios-glyphs/30/000000/github.png" />
      <hr></hr>
      <p>
        I built this site with React components and a JSON Resome Schema. The
        full source code can be found in my Github repo.
      </p>
    </div>
  );
};
export default Main;
